eah I love how player housing, at least in SWG, really made the world feel lived in.  There were guild towns you could visit to buy things or run quests.  Super fun.',NULL,'2014-04-04 18:52:56','2014-04-04 18:52:56'),(132,489,2,0,'Either UO2 or UXO (Ultimate Online Odyssey).  I was always hoping they could fix some of the problems that were resident in the current version by starting fresh.. but the projects kept getting cancelled.',NULL,'2014-04-05 16:13:27','2014-04-05 16:13:27'),(133,493,3,0,'Are there any good intro to not being a n00b in LoL videos I should watch?  I\'m tempted to try it again but didn\'t have a great first go.',NULL,'2014-04-07 16:26:13','2014-04-07 16:26:13'),(134,396,96,0,'I just got in the Alpha.  So far I\'m loving it!',NULL,'2014-04-07 16:59:10','2014-04-07 16:59:10'),(135,493,2,0,'Here is a really basic one... https://www.youtube.com/watch?v=JlKyQyqHFSo  but probably best is to jump Skype with me and Miss Chicky and we can play some bot games.\n\nAlthough I fear everyone has to be a n00b for a while.',NULL,'2014-04-07 17:28:14','2014-04-07 17:28:14'),(136,494,2,0,'Make it unhook the screen from the mouse and I am in!!!',NULL,'2014-04-08 22:59:55','2014-04-08 22:59:55'),(137,491,67,0,'I was so pleasantly surprised that they extended it!  Thankfully they didn\'t oust Syndra with all the otlher Champs that they removed from URF mode champs.  The champs that aren\'t playable in URF are: Ryze, Kassadin, Skarner, Soraka, Sona, Alistar, Nidalee, Hecarim and Kayle.',NULL,'2014-04-09 17:36:52','2014-04-09 17:36:52'),(138,496,2,0,'I wish we had won that game yesterday where we had 90% of the teams kills with Syndra/Warwick.  We can pull it off 4v5.. but 2v5 makes it REALLY tough.',NULL,'2014-04-09 21:32:20','2014-04-09 21:32:20'),(139,506,2,0,'I saw that they just released it for the PS4.  I wonder if it will be cross compatible or if everyone is going to have to upgrade.',NULL,'2014-04-15 13:36:27','2014-04-15 13:36:27'),(140,506,3,0,'Well I know