'67,147','2014-04-18 12:45:15','2014-04-18 12:45:15'),(149,513,67,0,'I also enjoy not arguing over a role, but I definitely feel like I need to take a more dominant position, in order to push my team.  I played support at bot & our team got toasted.  When I moved to a Mid position player, we stood a little better chance.  It is frustrating to be 2/5 in teambuilder.',NULL,'2014-04-18 12:47:02','2014-04-18 12:47:02'),(150,490,176,0,'Became a vamp last week, it\'s super fun!',NULL,'2014-04-18 13:49:42','2014-04-18 13:49:42'),(151,506,3,0,'Yeah still waiting for the MMO that really nails end game... I\'m excited to see what WildStar does.  And I heard 1/3 of the content for ESO is for after level cap.',NULL,'2014-04-18 14:10:13','2014-04-18 14:10:13'),(152,511,3,0,'I\'ve been waiting on pulling the trigger... but I didn\'t know about name reserving *grabs wallet*',NULL,'2014-04-18 14:11:20','2014-04-18 14:11:20'),(153,509,3,0,'I\'m getting a Matrix dodging bullets vibe.','148','2014-04-18 14:12:07','2014-04-18 14:12:07'),(154,514,178,0,'Personally, I have my eye on the game just to see if their experience from L4D 1/2 has passed into their new game',NULL,'2014-04-18 14:37:13','2014-04-18 14:37:13'),(155,514,3,0,'Yeah my buddy played it a bit at PAX East and he said out of the gate it was awesome but fears it\'s longevity. ',NULL,'2014-04-18 16:35:15','2014-04-18 16:35:15'),(156,515,2,0,'This will be fixed ASAP...or the child in my picture will have his light saber taken away... well.. maybe not something that cruel, but I\'ll think of something!',NULL,'2014-04-18 18:31:45','2014-04-18 18:31:45'),(157,511,154,0,'You\'re making the right decision, Drsleak. I have decided on which name I\'m going to reserve, although that will most likely be unnecessary as the names I usually choose are not generally taken in online games. They\'re unique.',NULL,'2014-04-18 18:45:44','2014-04-18 18:45:44'),(158,514,154,0,'Four players hunting a massive boss? That reminds me of Monster Hunter.',NULL,'2014-04-18 19:28:25','2014-04-18 19:28:25'),(159,515,148,0,'Ouch, lol. And hey, how about another bug report - if I\'m supposed to receive notifications for comments on things I post, that seems to be having problems at the moment, as I didn\'t get one and only saw yours because I saw \"1 comment\" under it in the feed with the usual grey text.',NULL,'2014-04-18 19:29:38','2014-04-18 19:29:38'),(160,515,154,0,'Is there a suggestions box around anywhere?',NULL,'2014-04-18 19:31:57','2014-04-18 19:31:57'),(161,514,3,0,'Yeah... but your friend is the MONSTER!',NULL,'2014-04-18 19:36:17','2014-04-18 19:36:17'),(162,494,148,0,'Another couple things disconcerting with ESO is the lack of underwater swimming and auction house. Wildstar has been satisfying all of my personal MMO cravings though, so I have nothing to complain about!',NULL,'2014-04-18 19:37:40','2014-04-18 19:37:40'),(163,515,3,0,'Send any ideas a long to support@zergid.com suggestions welcome!',NULL,'2014-04-18 20:03:19','2014-04-18 20:03:19'),(164,513,181,0,'Autarch I totally agree.  Champion selection should occur while the group is together, not prior.  Teams go into team builder with a double blind, not only do they not know what they\'re up against, but they also do not even know what their own team is playing.  \n\nSomething should be changed so that champion select occurs after the team is assembled.  It will help both the team and the player get better at the game by learning what comps work and what doesn\'t.','2','2014-04-18 20:03:48','2014-04-18 20:03:48'),(165,515,2,0,'Hey Dr, I have been using suggestions@zergid.com for bug report.  The link is supposed to go up on the top right of the site today (or tomorrow).  Although an e-mail to support@zergid.com will get noticed too, it just doesn\'t send me an alert.\n',NULL,'2014-04-18 20:12:42','2014-04-18 20:12:42'),(166,515,2,0,'Aera... notification for comments is on the top of our added feature list, but currently it not showing an alter for new comments isn\'t a bug... but we do realize it is something we absolutely need to add soon!',NULL,'2014-04-18 20:13:19','2014-04-18 20:13:19'),(167,506,181,0,'DrSleak I would advise you not to play it if you want something out of the endgame.  The endgame is limited to a single raid that comprises of 9 scenario style events that require you to clear a guantlet, kill a boss (with some difficult mechanics) but once you have done it once, it starts into the grind for gear which is extremely boring when it could be up to three months before new content (which it was).\n\nIf you like lore and story though the game does a fairly good job with that end and questing is not very bad at all.  ',NULL,'2014-04-18 20:28:03','2014-04-18 20:28:03'),(168,515,148,0,'Ah, sounds good! Maybe at some point in the future, people could add their own profile backgrounds, or maybe just change the color schemes of their page? That\'s of course nothing major at all, just a little personalization touch will make people feel more comfortable.','2','2014-04-18 20:32:09','2014-04-18 20:32:09'),(169,515,148,0,'Or maybe instead of colors and such, maybe allowing them to drag things around and re-organize future modules. Still, nothing very important.','2','2014-04-18 20:56:14','2014-04-18 20:56:14'),(170,515,2,0,'Just spoke to our CTO and he assured me that the fixes are coming this evening, including deleting the null guilds, so you will be able to create Umbra in all the games.\n\nI love the idea of being able to better personalize profile pages.  One of our plans going forward is to make character pages more specific for games, so creating a character page for a SWTOR character will look different and contain different information than a LoL character.  \n\nFor this first Alpha we went with an \"all in\" type design, but certainly want to give it more customization in the future.','148','2014-04-18 22:06:06','2014-04-18 22:06:06'),(171,516,2,0,'Gee.. That Warwick kinda kicked a$$ in that match, didn\'t he??  :)',NULL,'2014-04-18 22:06:41','2014-04-18 22:06:41'),(172,515,154,0,'You\'ve done an excellent job on the site so far. Even though it\'s only in Alpha, I think it still looks rather nice. I think having rounded display pictures for our profiles and character pages was a nice touch.','2','2014-04-18 22:44:44','2014-04-18 22:44:44'),(173,514,154,0,'So, there\'s five players, or does one of the players control a character and a boss? This is fascinating. I must research this more. To Google!',NULL,'2014-04-18 23:39:50','2014-04-18 23:39:50'),(174,511,3,0,'Yeah not many people taking DrSleak or Va\'leek now a days... but better safe than sorry.',NULL,'2014-04-18 23:40:25','2014-04-18 23:40:25'),(175,514,3,0,'Haha... yeah it\'s five players, four co-op, one PvP.  Crazy right?','154,154','2014-04-19 00:44:50','2014-04-19 00:44:50'),(176,506,3,0,'Duly noted Renten... I think I\'ll probably pass on it, though my one friend playing it will be pissed. ',NULL,'2014-04-19 00:46:46','2014-04-19 00:46:46'),(177,514,154,0,'I don\'t think I\'ve ever seen a non-MMO that\'s both PvE and PvP at the same time. Maybe they could make a version where the four players have to defend the boss from NPC\'s that are hunting it.',NULL,'2014-04-19 08:11:50','2014-04-19 08:11:50'),(178,511,154,0,'Aye. Yesterday, I tried to create a new character, and all of the names I usually choose are already taken, which is a first. I will definitely be reserving my name.',NULL,'2014-04-19 08:13:09','2014-04-19 08:13:09'),(179,510,154,0,'Honestly, I suck at MOBA-type games, but I would still love the chance to try this one out. I\'d be curious to see how Blizzard\'s gone about it.',NULL,'2014-04-19 08:15:04','2014-04-19 08:15:04'),(180,506,154,0,'Star Wars: The Old Republic was good, up until the point they went \"free-to-play,\" at which point they added too many limitations to free accounts to make it worthwhile. I did, however, enjoy Final Fantasy XIV: A Realm Reborn. While I didn\'t make it to endgame, I did have a lot of fun in it playing with my guild mates. I\'d been considering reactivating my subscription for a short while, maybe until WildStar is released. Even though the endgame is lacking, they could still add more content in patches and/or future expansions.',NULL,'2014-04-19 08:18:12','2014-04-19 08:18:12'),(181,514,3,0,'There are other NPC creatures around the map and I guess the job of the Boss is to kill and eat the NPC creatures to get bigger and stronger to level before facing the players and the players are trying to find and kill the boss player before he gets too powerful.  Very interesting.','154','2014-04-19 12:05:08','2014-04-19 12:05:08'),(182,517,3,0,'My buddy has been trying to get me to play... if I break down I\'ll hit you up with the server we start on.  I\'m 50/50 right now.',NULL,'2014-04-19 12:07:17','2014-04-19 12:07:17'),(183,515,2,0,'You can crate now!','154','2014-04-19 12:34:12','2014-04-19 12:34:12'),(184,516,147,0,'I feel sorry for the other team. :( Look at those scores/cs.',NULL,'2014-04-19 14:49:39','2014-04-19 14:49:39'),(185,513,147,274,'Yeah, I know what you mean by that Chicky. I used to main support but have switched to ad carry. It\'s such a big difference when you can actually carry a game..',NULL,'2014-04-19 14:57:45','2014-04-19 14:57:45'),(186,517,147,0,'Game got boring way too fast. Once I was done with turn 5, there wasn\'t anything left to do. : / ESO has its hooks in me right now, so doubt I\'ll be returning anytime soon.',NULL,'2014-04-19 14:59:06','2014-04-19 14:59:06'),(187,516,2,0,'Few a few minutes, I thought we were going to pull off a complete shutout.',NULL,'2014-04-19 18:13:36','2014-04-19 18:13:36'),(188,519,67,0,'Nice Custom Banner.  I am not very artsy - hum drum boring, me.  I still don\'t even know how to do it on Facebook.',NULL,'2014-04-19 18:17:02','2014-04-19 18:17:02'),(189,518,154,0,'The problem with using tutorials for streaming is everybody\'s computer is different, and you\'ll need to tweak it until it\'s perfect for you. The only thing I can really recommend is using Open Broadcaster Software (OBS) as your streaming program.',NULL,'2014-04-19 20:57:26','2014-04-19 20:57:26'),(190,517,154,0,'If you get only 1% more, you\'d be 51/49, and then you could get into it. I mean, the game is great, but if you\'re picky about things like PvP, then you\'re not going to find very much enjoyment in it.',NULL,'2014-04-19 20:58:37','2014-04-19 20:58:37'),(191,519,154,0,'I\'m a cover picture surfer on Facebook. I tend to change it to feature one of the characters from a game I\'m playing or an anime I\'m watching at that particular moment in time. On Facebook, my cover picture is currently Milla Maxwell from Tales of Xillia. It\'s been there since October 21, 2013, so it\'s time for a change. I think I also need to change my picture on ZergID.','147,2','2014-04-19 21:02:19','2014-04-19 21:02:19'),(192,519,147,0,'Haha thanks. It\'s just a random image I had of Morgana.','154,2','2014-04-19 21:02:28','2014-04-19 21:02:28'),(193,520,2,0,':)','154,148','2014-04-19 22:39:16','2014-04-19 22:39:16'),(194,521,148,0,'Search \"UMBRA\" in the search bar. Apply to the \"UMBRA\", not D3 or Minecraft Umbra.',NULL,'2014-04-20 01:16:00','2014-04-20 01:16:00'),(195,521,147,0,'It says Wildstar. : / What about those of us that might not play Wildstar?',NULL,'2014-04-20 01:27:28','2014-04-20 01:27:28'),(196,521,154,0,'Additional guilds could be made for each game UMBRA has a presence in.',NULL,'2014-04-20 01:32:57','2014-04-20 01:32:57'),(197,521,147,0,'Just realized that. Made an ESO one. Is it possible or going to be possible to transfer ownership of these guilds over?',NULL,'2014-04-20 01:34:32','2014-04-20 01:34:32'),(198,521,154,0,'Yes, I\'d imagine it\'s on the \"to-do\" list of the fine people responsible for this website. I\'m sure it\'ll be implemented before too long.',NULL,'2014-04-20 01:35:39','2014-04-20 01:35:39'),(199,521,2,0,'Actually, you can transfer ownership now.  Once the guild leader joins the guild, the person currently in control of the guild simply has to promote this person twice (once from member to officer and a second time from officer to leader).  Once the new person is promoted to leader, the guild ownership has been transferred and they will receive all of the application notices.\n\nYay!  Something we actually had ready to go!','147,154','2014-04-20 01:39:05','2014-04-20 01:39:05'),(200,521,154,0,'Well, there you go. Now, we just have to tackle the problem of half of these guilds being \"Umbra\" and the other half being \"UMBRA.\" Haha.',NULL,'2014-04-20 01:40:19','2014-04-20 01:40:19'),(201,521,147,0,'Haha Jack. You\'re right. I\'m pretty sure UMBRA is the recommended choice so I screwed up. Oh well. At least it gave me a chance to test closing a guild. Went flawless. :D',NULL,'2014-04-20 01:44:39','2014-04-20 01:44:39'),(202,521,154,0,'Practice makes perfect, as they say!','147','2014-04-20 01:48:33','2014-04-20 01:48:33'),(203,521,148,0,'I made it under Wildstar because to my knowledge you cannot add multiple guilds during creation.',NULL,'2014-04-20 02:04:56','2014-04-20 02:04:56'),(204,521,148,0,'I expect this function will be added at some point, so no need to create multiple guilds. We won\'t be recruiting here until later stages of beta when there is a larger audience, and by then we\'ll hopefully have UMBRA listed for all the guilds we play.',NULL,'2014-04-20 02:17:44','2014-04-20 02:17:44'),(205,521,147,0,'I just figured the more people testing the guild admin tools, the better. :)','154,2','2014-04-20 02:29:44','2014-04-20 02:29:44'),(206,521,148,0,'Ya for sure; makes sense - We\'re here to test!','154,2,4','2014-04-20 02:34:18','2014-04-20 02:34:18'),(207,518,3,0,'Cool.  Just didn\'t want to look too much like a tool the first stream... ya know.','154','2014-04-20 02:41:49','2014-04-20 02:41:49'),(208,520,3,0,'Bring it ON!  Zerg!!!','154','2014-04-20 02:42:08','2014-04-20 02:42:08'),(209,517,3,0,'Just broke down and bought it... playing with a buddy.  Primal server Malboro or something like that.','154','2014-04-20 02:43:14','2014-04-20 02:43:14'),(210,520,154,0,'You completely reminded me of Joe from Family Guy, there. \"BRING IT ON!\"','3','2014-04-20 02:45:17','2014-04-20 02:45:17'),(211,518,154,0,'Yeah, I know what you mean. Most of my streams consist of myself playing games and not talking, because I don\'t want to talk to myself.',NULL,'2014-04-20 02:48:15','2014-04-20 02:48:15'),(212,522,2,0,'Would you all like me to add your server to the Minecraft game?  We currently only have PC and Xbox as the servers, since Minecraft doesn\'t have traditionally fixed severs.  However, it would be easy for me to add UMBRA as a server (or whatever name you want) and that way you can all add your Minecraft character to that server.  Just tell me what name to add.',NULL,'2014-04-20 12:26:39','2014-04-20 12:26:39'),(213,517,154,0,'Are you in a guild? If so, could I join? xD',NULL,'2014-04-20 13:17:35','2014-04-20 13:17:35'),(214,522,148,312,'Since it\'s a \"Minecraft Realm\" I\'m hosting on a rented Mojang server, it can only hold 10 people at a time, so it\'s really just a little casual time sink for a handful of us, nothing really big. I don\'t think we\'d need our server to be on the list. If however this would be a good testing opportunity, I\'m up for that. We just have it labelled as \"Umbra\'s Realm\" at the moment.',NULL,'2014-04-20 16:14:30','2014-04-20 16:14:30'),(215,522,2,0,'I went ahead and added Umbra\'s Realm as a server in Minecraft.. even if it is just for testing purposes.. why not add it.',NULL,'2014-04-20 18:27:58','2014-04-20 18:27:58'),(216,517,3,0,'No guild just trying it out, but I\'m Va\'leek on that server if you want to friend me up.  We\'re playing on the PS4 so if you\'re PC not sure if their is cross server stuff.',NULL,'2014-04-20 18:41:17','2014-04-20 18:41:17'),(217,523,154,0,'Somehow, the download encountered an error right after I left for work, so it didn\'t finish. It\'s been encountering errors on and off ever since I got home. It\'ll be done... Eventually.',NULL,'2014-04-21 02:18:39','2014-04-21 02:18:39'),(218,523,3,0,'Haha that\'s the worst.  Reminds me of the old pirate FTP days, leaving a download running over night and waking up to... nothing.',NULL,'2014-04-21 11:59:08','2014-04-21 11:59:08'),(219,523,154,0,'It did it again. It was downloading beautifully, and I went to bed. When I woke up, no progress had been made whatsoever from when I left my computer. This is actually starting to really annoy me. I\'ve wasted an entire day trying to download this thing.','3','2014-04-21 12:36:04','2014-04-21 12:36:04'),(220,517,154,0,'I\'ve tried both \"Va\'leek\" and \"Valeek,\" and neither appear to be working. It could be that I can only add people when they\'re online. If you get a chance, try adding me: Jeceraine Lias.',NULL,'2014-04-21 13:23:28','2014-04-21 13:23:28'),(221,524,3,0,'First off best thumbnail ever... secondly, I figured something like this was happening because they brought down the ban hammer a few days ago.  Gotta love exploits!',NULL,'2014-04-21 13:57:53','2014-04-21 13:57:53'),(222,524,2,0,'LOL.  Athene is the master of the thumbnail!!',NULL,'2014-04-21 15:23:17','2014-04-21 15:23:17'),(223,528,143,0,'test ZERG!!','148','2014-04-21 19:36:01','2014-04-21 19:36:01'),(224,521,143,0,'what up','154','2014-04-21 20:05:27','2014-04-21 20:05:27'),(225,527,187,0,'super cool',NULL,'2014-04-21 20:12:06','2014-04-21 20:12:06'),(226,527,153,0,'nice :)',NULL,'2014-04-21 20:12:29','2014-04-21 20:12:29'),(227,528,189,0,'-_-\n',NULL,'2014-04-21 20:33:04','2014-04-21 20:33:04'),(228,527,192,0,'waddup\n',NULL,'2014-04-21 20:44:29','2014-04-21 20:44:29'),(229,531,2,0,'\n\nSuggestions: Part II\n\n- Tying creation of guilds and events to main profile, as opposed to specific characters.  This would allow someone to create a guild from their profile and then later link a toon to it.. similar with events.\n\n- Create more game specific character creation pages, such as allowing people to add all 6 professions in ESO.  Further, allow people to showcase the levels they have achieved.\n\n\nOverall... your suggestions are AMAZING and we pretty much plan to implement them all in one form or another within the next 6-8 months.  Some will take longer than others, as they require more work.  If you have more or want to discuss the ones above.. please add to this post or e-mail me in game or at suggestions@zergid.com ',NULL,'2014-04-21 23:38:45','2014-04-21 23:38:45'),(230,530,2,0,'Additional Bugs:\n\n- Unable to add multiple characters from same game/faction/server into a guild.\n\n- When someone changes their password, DO NOT send the new password to them via e-mail, but instead simply send message that the password has been changed, without the specific password data.  *DERP*',NULL,'2014-04-21 23:40:44','2014-04-21 23:40:44'),(231,530,154,0,'Ah, so that\'s the problem. I was wondering why I had a phantom notification. You guys are doing an amazing job!',NULL,'2014-04-22 10:23:51','2014-04-22 10:23:51'),(232,530,154,0,'Also: Would making a \"mark all as read\" button be a work-around for the phantom notification bug?',NULL,'2014-04-22 10:40:50','2014-04-22 10:40:50'),(233,530,2,0,'Some updates:  The following bugs are reported to me as fixed.. so if you see them again.. please let me know.\n\n- Password information removed from e-mail sent when you change your password.\n\n- The red #1 staying permanently over deleted unread messages should now be gone and shouldn\'t come back.  If you still have it, please let me know.\n\n- Twitch video can now be added via embed script\n\n- Friend Request has been added to ingame mail friend requests.\n\nAll other bugs are still \"in progress\"',NULL,'2014-04-22 15:22:24','2014-04-22 15:22:24'),(234,530,2,0,'Correction.. Twitch video embed is not working.  I just tested it myself and received an error, so toss that one back onto the \"in progress\" pile.',NULL,'2014-04-22 15:27:47','2014-04-22 15:27:47'),(235,532,148,0,'I\'ve been in beta since the early closed beta for long-term testers, and I very thoroughly tested the housing. I LOVE it, it is incredibly in-depth and nearly overwhelming. There is almost no limit to what you can do in housing, and the amount of items you can find, purchase, use, etc, is stupendous. Just yesterday I went to see how large I could make a certain type of tree, and the size scale went so high that the base of the tree enveloped my entire house and almost my entire land plot. It was all inside a tree!\n\nThe items all have physical meshes and you can jump on them, use them as ramps, traps, anything. There is a large amount of plugs you can put on your plot, and most of them can be upgraded to be more fancy and useful.\n\nYou can get plot plugs (FAB kits) and random items from just doing what you do in the world below, whether it be questing or mindless killing, so you really are rewarded for playing however you\'d like.\n\nIn my old house i used a tiny little wax candle item, expanded it to about 100000x size and put it under my floor so that I had a giant flame in my basement with no visible candle. Hell, you can even stick a giant piece of toast on the wall with a sword stuck through it.\n\nWith each item you can open an advanced options/manipulation option with more options than you probably hoped for. The ONLY thing lacking is morphing the actual dimensions of items to be disproportionate and skewed, but that\'s really not a problem.\n\nGot any specific questions? I\'ll be glad to answer them.',NULL,'2014-04-22 18:35:45','2014-04-22 18:35:45'),(236,532,3,0,'Wow super exciting... how do they interact with the world?  Meaning, if I\'m not grouped with you can I see your housing?  I know they are off shoot planets but can you visit peoples to see what people are doing?\n\nThanks!','148','2014-04-22 19:04:05','2014-04-22 19:04:05'),(237,530,3,0,'As I\'m sure people realized these fixes haven\'t been uploaded to the live server, hence they are all still bugs :)',NULL,'2014-04-22 19:05:38','2014-04-22 19:05:38'),(238,532,148,0,'You can set people as your neighbor in a list you have, and that allows them to easily access your home at will, where ever they may be at any time. There is a setting to set people as your room mate, but I have not tested that out. That setting is supposed to let them move things, place things, put things in your house crate, and harvest any plugs you have such as a farm or mine. I believe you can set how much they get from harvesting your plot\'s plugs.\n\nYou have a \"House Recall\" similar to your other recall, which is really just the equivalent of a hearthstone. Teleporting home or to a town/city with a short channelling spell with a cooldown. On your plot is a recall pad that you can step on to return to where you used your House Recall.\n\nAnd ya, the plot is pretty much a chunk of Nexus ripped off the ground and hovering high in the clouds. You can see other background plots hovering about the sky when you\'re home and looking over the edge.\n\nAnother couple great things is that you can even customize the sky in which your plot is located. You can have it in rain, storms, sun, red and ominous, rainbows, and so much more. Inside your house you can change the lighting type from a large list, including weird things like red fog and super-dark and gritty.\n\nMany items have a sort of a buff on them that helps when you log out in the house or afk there. Putting a \"discarded bra\" on the floor can give your home a \"comfort 1\" buff, haha.',NULL,'2014-04-22 19:58:11','2014-04-22 19:58:11'),(239,532,148,0,'P.S. - There is a tool to teleport to a random person\'s house as well, assuming they have their house set to public access.',NULL,'2014-04-22 19:59:08','2014-04-22 19:59:08'),(240,535,194,0,'I really enjoy Spellslinger. They can be DPS or Healer and both work out pretty well.',NULL,'2014-04-23 18:15:52','2014-04-23 18:15:52'),(241,535,3,0,'Yeah crazy that there is no \"DPS Only\" spec... smart.','148','2014-04-23 19:09:07','2014-04-23 19:09:07'),(242,536,3,0,'No but Hearthstone on the iPad is GLORIOUS! ',NULL,'2014-04-25 16:21:02','2014-04-25 16:21:02'),(243,537,148,0,'Oh it gets better. Also, I think you should apply to Umbra! There\'s no doubt you\'d be a great fit; You and Autarch both. If you\'re going to be playing Wildstar, why not join good ol\' Guild Umbra to make it even better? :D',NULL,'2014-04-25 21:22:23','2014-04-25 21:22:23'),(244,537,3,0,'When launch comes around, you gotta deal.','148','2014-04-25 22:26:08','2014-04-25 22:26:08'),(245,537,2,0,'Did you get extra beta keys? Watched some gameplay online and it looks interesting, looks like they kept alot of what I liked about GW2, but got rid of the \"we don\'t need no stinkin healers\" concept.',NULL,'2014-04-26 19:13:02','2014-04-26 19:13:02'),(246,537,3,0,'No extra beta keys but if you pre-order you get access.',NULL,'2014-04-27 00:36:19','2014-04-27 00:36:19'),(247,537,2,0,'Dang, they took out my old trick.  I don\'t like to \"pre-order\" for beta access unless I can cancel the pre-order (like I did for Star Trek Online and The Secret World after I tried the beta). \n\nIt used to be if you bought through Amazon, it treated it as a \"Pre-Order\", but they would send you the code right away... then if you didn\'t like it, you could cancel the order anytime before the game release.\n\nNow, they consider it a \"purchase\" the moment you get the beta code.\n\nLet me know if they give you some additional codes.. 2 weeks ago Curse gave away 300K of them, so likely there will be another giveaway I can jump on between now and June 3.',NULL,'2014-04-27 11:45:33','2014-04-27 11:45:33'),(248,537,3,0,'done and done',NULL,'2014-04-27 15:58:51','2014-04-27 15:58:51'),(249,544,67,0,'*sigh* It is amazing how much a \"team\" can mess up the game for one player.',NULL,'2014-04-27 23:10:00','2014-04-27 23:10:00'),(250,545,2,0,'PIZZA... well.. maybe not in LA.',NULL,'2014-04-28 01:09:54','2014-04-28 01:09:54'),(251,545,3,0,'Agreed on the Pizza and there\'s some good pizza in LA!  Crispy Crust is pretty good, if you go fancy Pizzeria Mozza is great!',NULL,'2014-04-28 12:31:43','2014-04-28 12:31:43'),(252,545,197,0,'Pretty much anything that takes one hand or less','3,67','2014-04-28 12:42:37','2014-04-28 12:42:37'),(253,545,2,0,'One time I made the mistake of ordering Chinese food.  *NOTE*  Won Ton soup and healing in a PvP setting DO NOT MIX!!!  (my keyboard suffered for it!)',NULL,'2014-04-28 17:27:24','2014-04-28 17:27:24'),(254,545,67,0,'I know one thing, unless you like your ice cream, more like soup...it makes a poor game-time treat.  I often grab some, start a game, and wind up with just melted ice cream.',NULL,'2014-04-29 13:25:41','2014-04-29 13:25:41'),(255,549,67,0,'Honestly, only 32gb of RAM?  at that cost?',NULL,'2014-05-02 12:10:39','2014-05-02 12:10:39'),(256,549,67,0,'What terabytes?  We have a similar PC in our house with the GTX 760, and it was quite a bit less.',NULL,'2014-05-02 12:13:51','2014-05-02 12:13:51'),(257,549,3,0,'Was thinking of upgrading my rig for WildStar... there was a bit of a chug issue every once and a while.',NULL,'2014-05-02 18:42:23','2014-05-02 18:42:23'),(258,549,3,0,'Where did you get the Comp?',NULL,'2014-05-02 18:42:33','2014-05-02 18:42:33'),(259,549,2,0,'I got my monster from cybperower PC on a black friday special last year.\n\nHere\'s my basic stats:\n\nCPU: Intel(R) Core™ i7-4820K Quad-Core 3.70 GHz 10MB Intel Smart Cache \n\nFAN: Asetek 510LC 120mm Liquid Cooling CPU Cooler - Enhance Cooling \n\nHDD: 2TB (2TBx1) SATA-III 6.0Gb/s 64MB Cache 7200RPM HDD (Single Drive)\n\nMOTHERBOARD: GIGABYTE X79-UP4 ATX w/ Ultra Durable 5, GblAN, 4 GEn3 PCIe x16, 2 PCIe x1, 1 PCI\n\nVIDEO: NVIDIA GeForce GTX 760 4GB GDDR5 PCIe 3.0 x16 Video Card [+189] (* EVGA ACX Cooling Edition Powered by NVIDIA)\n\nMEMORY: 32GB (8GBx4) DDR3/1866MHz Quad Channel Memory [+175] (ADATA XPG V2)\n\nI think the 780 is a big jump over the 760.. so that is probably most of the cost difference.\n\n\n',NULL,'2014-05-02 19:30:46','2014-05-02 19:30:46'),(260,549,148,0,'The upgrade from 770 to 780 alone is a big jump in price unfortunately, Chicky. And ya, I have no use for higher than 32 even if I was running 5 games at once, haha.\n\nIt\'s a custom built Alienware Aurora ALX, Drsleak. Lots of people hate on Alienware because they\'re a bit pricey and now owned by Dell, but there\'s really no real problem with them other than  a little increase in price compared to building yourself.\n\nBadass PC, Autarch!\n\nOh and P.S. - my SSD is only 512gb with a secondary regular 1tb drive. I\'ll upgrade the SSD at a later date when I need more space. I have some external drives for my absurdly large archives though, so it\'s all fine.','2','2014-05-03 17:31:10','2014-05-03 17:31:10'),(261,549,2,0,'I had an Alienware before I bought this one... I love Alienware and probably would have gotten another.  I just couldn\'t pass up the price I was able to get on this one.. that ran some psycho black Friday special (They ran it between midnight and 3AM only), so I spent about 1650 shipping included on it.',NULL,'2014-05-04 13:43:02','2014-05-04 13:43:02'),(262,549,67,0,'As with any major purchase, as long as you are THRILLED with it, cuz it is just what you want, then it is TOTALLY worth it!  Congrats!',NULL,'2014-05-05 22:07:57','2014-05-05 22:07:57'),(267,574,2,0,'I didn\'t do the wildstar preorder, but it sounds like you didn\'t select your name at the time of Pre-order?!  That seems like it would have been a better system, as people who ordered early would (and should) get first choice, rather than a free for all a week or so before the game releases.','148','2014-05-16 21:19:00','2014-05-16 21:19:00'),(268,582,2,0,'LOL.  What do the flags do for you?  It reminds me of finding the \"view\" points in GuildWars2',NULL,'2014-06-07 19:28:06','2014-06-07 19:28:06');
