DROP TABLE IF EXISTS `zid_feeds`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `zid_feeds` (
  `feed_id` int(11) NOT NULL AUTO_INCREMENT,
  `id` int(11) NOT NULL,
  `character_detail_id` int(11) DEFAULT NULL,
  `feed_media_id` varchar(1000) DEFAULT NULL,
  `feed_text` varchar(2000) NOT NULL,
  `is_visible` tinyint(1) DEFAULT NULL,
  `zergs` varchar(5000) DEFAULT NULL,
  `parent_feed_id` int(11) DEFAULT NULL,
  `created_date` datetime DEFAULT NULL,
  `last_modified_date` datetime DEFAULT NULL,
  `guild_parent_feed_id` int(11) DEFAULT NULL,
  `feed_rezerg_text` varchar(1000) DEFAULT NULL,
  PRIMARY KEY (`feed_id`),
  KEY `FK_zid_feeds` (`id`),
  KEY `FK_zid_character` (`character_detail_id`),
  CONSTRAINT `FK_zid_feeds` FOREIGN KEY (`id`) REFERENCES `zid_users` (`id`),
  CONSTRAINT `FK_zid_feeds_PK_zid_character_details` FOREIGN KEY (`character_detail_id`) REFERENCES `zid_character_details` (`character_detail_id`)
) ENGINE=InnoDB AUTO_INCREMENT=594 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

