sh versions from the 1914 translation by H. Rackham.\n\nThere are many variations of passages of Lorem Ipsum available, but the majority have suffered alteration in some form, by inhttp://www.youtube.com/watch?v=_Ca12JSMN9Elook even slightly believable. If you are going to use a passage of Lorem Ipsum, you nee'),(365,124,NULL,'168','Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry\'s http://www.youtube.com/watch?v=Mq5OQQWbZWY standard dummy text ever since the 1500s, when an unknown printer took a ',0,NULL,NULL,'2014-03-15 21:22:32','2014-03-15 21:22:32',NULL,'NULL'),(377,2,NULL,'179','Athene talks about League of Legends v Heroes of the Storm\n\nVery interesting stuff:\n\nhttp://www.youtube.com/watch?v=ZTNHUUhyVoc',1,'2',NULL,'2014-03-15 23:05:24','2014-03-15 23:05:24',NULL,'NULL'),(381,2,NULL,'181','Ok this is a little long but for all those friends who have heard me talk (too much I know) about Star Wars Galaxies... watch this video to get a feel for how fun and social this game is.  Really makes you realize that a game like WoW, though fun, doesn\'t really feel like a living breathing world.\n\nI miss this game :(',1,'3',306,'2014-03-16 17:57:24','2014-03-16 17:57:24',NULL,'Never played SWG, but it certainly looks like fun!'),(384,2,NULL,NULL,'PvP v PvE \n\nWhen I first started MMORPGs in 1997 I was a PvE player, with little to no interest in PvP. I liked solving the puzzles of PvE and figuring out how to beat the hardest creatures in the games. Like, the Ancient Wyrm in UO, which I ultimately learned to solo (something that wasn\'t supposed to be possible). This moved on as they added the Champions to UO where a large group had to summon the Boss and defeat him. It was frantic and fun. \n\nBefore long PvE changed. It went from being frantic to rigid. Every person had a specific tasks that had to be preformed in a certain way. \"The hunter stands on the rock shooting the boss until the adds appear, then the hunter jumps to the other rock...\" Often times puzzles were solved by someone else and I found I was just being told what part to play, where to stand, etc. Almost every move the boss could make was predictable and/or choreographed \"when he raises his hammer, jump in the air, or you will get stunned.\". The UO guild Rebel Alliance was formed because a group of us refused to follow the specific rules of a raid. \n\nI ventured into PvMP (Player v Monster Player) in LoTRO and have been mainly PvP since. Although the first time beating a boss can still be fun, the unpredictability of PvP offered a puzzle that can never be \"solved.\" \n\nPvP is not without its drawbacks. Far too many people want to forget the elements of chance built in the system and believe winning a particular fight makes them \"better\" and lose all elements of sportsmanship in the process. Think of PvP like Poker. Someone can pull out a win on the river. If your crit procs at the right time, you win. If not, you lose. Victories in PvP are very short lived, because as fast as you win, you will find yourself on the losing end of a match or battle. \nOne day I hope a game comes along that can emulate the unpredictability of PvP in a PvE environment, but until then I main PvP. \n\nWhat about you all? PvE or PvP? And Why?\n',1,'2,5',NULL,'2014-03-16 20:36:52','2014-03-16 20:36:52',NULL,'NULL'),(385,82,NULL,'183','http://www.youtube.com/watch?v=WC7GZUXx3Nk - monkey business? Try finding the naughtiest monkey in every scene--and watch as she gets her comeuppance at the end! A classic monkey rhyme with delicious illustrations, this is sure to be a favorite on',0,NULL,NULL,'2014-03-16 21:49:57','2014-03-16 21:49:57',NULL,'NULL'),(386,82,NULL,'184','http://www.youtube.com/watch?v=WC7GZUXx3Nk-monkey-business-Try-finding-the-naughtiest- monkey-in-every-scene--and',0,NULL,NULL,'2014-03-16 21:54:39','2014-03-16 21:54:39',NULL,'NULL'),(387,82,NULL,NULL,'http://massively.joystiq.com/2014/03/16/shroud-of-the