ally interested to see how it is.  I LOVED housing in SWG.',1,'2',NULL,'2014-04-03 14:45:08','2014-04-03 14:45:08',NULL,'NULL'),(489,3,NULL,NULL,'So question: What MMO were you most excited about before it was cancelled pre-launch?  Mine is easy... Mythic Entertainment was making \"Imperator\" an Alternate Earth Massively Multiplayer Online Role-playing Game, set in a future world where Ancient Rome never fell',1,'2',NULL,'2014-04-04 19:07:02','2014-04-04 19:07:02',NULL,'NULL'),(490,3,255,'230','Ok ESO people... I just found out that you can become a Vampire or Werewolf if you find the right rare spawn and get bitten... this is kind of amazing!  \n\nSo, who out there is going to get freaky!',1,'136,2',NULL,'2014-04-06 20:14:56','2014-04-06 20:14:56',NULL,'NULL'),(491,2,NULL,NULL,'Only 1 more day for League of Legends fans to enjoy URF (Ultra Rapid Fire).  I suspect it will come out with the next patch.   This game mode has ruined me for all others.',1,NULL,NULL,'2014-04-07 13:31:50','2014-04-07 13:31:50',NULL,'NULL'),(493,2,NULL,NULL,'Interested in learning how to Jungle in League of Legends.. Nightblue is doing an excellent live tutorial!\n\nhttp://www.twitch.tv/nightblue3',1,'2,146',NULL,'2014-04-07 15:39:46','2014-04-07 15:39:46',NULL,'NULL'),(494,3,255,'231','A little birdie told me that ESO end game was 1/3 of the total content of the game... if that\'s true it\'s mind blowing!\n\nThat said the look at the new content update \"Craglorn\" looks amazing.',1,'2,157',NULL,'2014-04-08 19:59:09','2014-04-08 19:59:09',NULL,'NULL'),(495,2,139,'232','Warwick and Syndra... OP AS HELL in URF mode.  We won this 4v5',1,'2,67',NULL,'2014-04-09 00:48:05','2014-04-09 00:48:05',NULL,'NULL'),(496,67,NULL,NULL,'URF on League of Legends is SOOOOO COOL!  I have been making a killing on Syndra!',1,'2',NULL,'2014-04-09 17:32:12','2014-04-09 17:32:12',NULL,'NULL'),(500,2,NULL,'233','Yeah... Warwick and Syndra can absolutely carry!!',1,'2',NULL,'2014-04-11 20:07:24','2014-04-11 20:07:2