Anyone else feel like the skill level of players in Teambuilder mode is much lower than those in blind/draft pick? I like not having to argue for a role but it is a little disappointing.',1,'2,67,186',NULL,'2014-04-18 10:29:40','2014-04-18 10:29:40',NULL,'NULL'),(514,3,NULL,'241','Ok this could be super fun!  Evolve is from the Left 4 Dead people and it\'s four players hunting a massive boss... that\'s player controlled!\n\nCrazy',1,'178,113',NULL,'2014-04-18 14:14:03','2014-04-18 14:14:03',NULL,'NULL'),(515,148,NULL,'242','We may get our guild page up and running soon. I\'ve submitted the reports and a request to either place me in the already-created empty guild so that I can start inviting, or to delete the empty one so that a new one of the same name can be created once the bug is resolved.',1,'2,148',NULL,'2014-04-18 17:39:23','2014-04-18 17:39:23',NULL,'NULL'),(516,67,NULL,'243','I think I did well in URF mode.  That was fun!',1,'2',NULL,'2014-04-18 18:53:53','2014-04-18 18:53:53',NULL,'NULL'),(517,154,NULL,NULL,'Does anyone here still actively play Final Fantasy XIV: A Realm Reborn? If so, which server do you play on?',1,NULL,NULL,'2014-04-19 08:44:41','2014-04-19 08:44:41',NULL,'NULL'),(518,3,NULL,NULL,'Anyone know of a good Twitch.tv setup tutorial... I\'m thinking of starting a stream channel?',1,NULL,NULL,'2014-04-19 16:09:05','2014-04-19 16:09:05',NULL,'NULL'),(519,147,NULL,'244','By the way: In case anyone was wondering, I\'m pretty sure the custom banner resolution is 640x210. At least, that\'s what the default was and worked when I put one up.',1,'148,67',NULL,'2014-04-19 16:17:36','2014-04-19 16:17:36',NULL,'NULL'),(520,154,NULL,NULL,'On this site, \"Zerg rushing\" has a new meaning: I\'ve been \"Zerging\" everything and commenting on it. I love this site.',1,'2,147,2,3',NULL,'2014-04-19 21:07:41','2014-04-19 21:07:41',NULL,'NULL'),(521,148,NULL,'245','Our UMBRA guild page has been successfully created. Start requesting invites, y\'all!',1,'154,147,2,4,143,161',NULL,'2014-04-20 01:15:10','2014-04-20 01:15:10',NULL,'NULL'),(522,148,312,NULL,'Just a reminder, we do now have a 24/7 Minecraft server open for all of your casual time-sink desires. Just post your Minecraft username to this thread - http://umbraguild.guildlaunch.com/forums/viewtopic.php?t=10104711&gid=265361',1,'154,147,2',55,'2014-04-20 01:56:28','2014-04-20 01:56:28',55,'Linked post from our guild page. Test!'),(523,154,NULL,NULL,'I\'ve reactivated my Final Fantasy XIV: A Realm Reborn account, and it should do well enough, at least until WildStar\'s released. I haven\'t decided which server to play on yet, and I won\'t be able to play it before I have to go to work today. It\'s downloading, though, so it\'ll be ready and waiting for me when I get home!',1,'2,4',NULL,'2014-04-20 15:54:45','2014-04-20 15:54:45',NULL,'NULL'),(524,2,NULL,'246','So I guess there was a major exploit in ESO that allowed people to dupe legendary gear and billions of gold.  ',1,'148',NULL,'2014-04-21 12:43:11','2014-04-21 12:43:11',NULL,'NULL'),(525,113,310,'247','Ok this could be super fun!  Evolve is from the Left 4 Dead people and it\'s four players hunting a massive boss... that\'s player controlled!\n\nCrazy',1,NULL,514,'2014-04-21 15:37:55','2014-04-21 15:37:55',NULL,'NULL'),(526,113,310,'248','So I guess there was a major exploit in ESO that allowed people to dupe legendary gear and billions of gold.  ',1,NULL,524,'2014-04-21 15:43:57','2014-04-21 15:43:57',NULL,'NULL'),(527,143,NULL,'249','Our UMBRA guild page has been successfully created. Start requesting invites, y\'all!',1,'143,153,192,2,194',521,'2014-04-21 19:18:15','2014-04-21 19:18:15',NULL,'What\'s up everybody!  Let\'s see what is going on with the ZergID.'),(528,143,NULL,NULL,'Hey, it\'s time to get the guilds together to test out functionality of ZergID',1,'143,148,3,2',NULL,'2014-04-21 19:35:34','2014-04-21 19:35:34',NULL,'NULL'),(530,2,NULL,NULL,'First.. I want to thank all of Guild UMBRA for their incredible effort.  I wanted to put up a couple of posts where I go through the bugs that have been reported, so people know if something they found has already been reported and is being worked on:\n\nBelow is a list of current bugs we are working on.  NOTE:  These are just the bugs  (where something isn\'t functioning as intended).. I will have a separate thread for suggestions/improvements to the site:\n\n-  In creating a bio, it doesn’t keep formatting.  If someone puts in multiple spaces or an enter, it should keep the formatting.\n\n- When someone sends a friend request, it should label that mail as FRIEND REQUEST instead of just having the person\'s name.\n\n- When creating an event, we should have \"All Day\" as a selection.\n\n- The bug report link in the upper right is not working correctly all the time.  It is supposed to generate an e-mail to suggestions@zergid.com but for people without a default e-mail client selected, it does nothing.\n\n- Guild officers posts are not showing up in the members sections.  Officers are also members of the guilds and their posts should show up in both sections.\n\n- SSL is not functioning.  This happened because we had to switch our Open SSL and is supposed to be fixed shortly.\n\n- Notification of new message will not disappear if the user deletes a message without reading it, leaving the red #1 over the mail icon for ever and ever.\n\n- Unable to embed live twitch video in the attach some media link.\n\nIf there is BUG you found (or find in the future) please feel free to add it to this post or e-mail me at suggestions@zergid.com and I will continue to add it to this list.\n',1,'148,2',NULL,'2014-04-21 23:13:53','2014-04-21 23:13:53',NULL,'NULL'),(531,2,NULL,NULL,'Suggestions:  The follow is a list of suggestions for additions/improvements to the website.  I didn\'t put these in bug reports, because they are things we either didn\'t include or simply didn\'t think about as we developed the site and you all have come up with some AMAZING ideas.  We are currently working on implementing some of these very soon, as I will indicate below, while others will take and/or major restructuring and thus are not being immediately developed, but are part of our \"product roadmap\" for the future.\n\n- A crop tool for the profile banner, similar to what we have for profile images  (This is currently being developed)\n\n- Adding a \"join guild\" link next to the start guild link.  (This is currently being developed)\n\n- Being able to see who Zerg\'d your posts (This is currently being developed)\n\n- Notification of new comments being made to posts (This is currently being developed.. current solution is to have posts with new comments show the word comments and the number of comments in bold to indicate new comments have been added)\n\n- Ability to attach media when editing a post as well as when first entering the post (this is currently being developed)\n\n- Making distinction between character/game/server clearer on the left panel (this is currently being developed)\n\n- Adding an invite button to a guild, so the guild leader can invite people directly into a guild without them having to apply (this is currently being developed)\n\n- Ability change the order of their top characters and guilds on the left side of the profile page and in general add more customization to the profile pages.  \n\n- Ability to add guilds that are multi-game guilds, so that guilds such as UMBRA do not have to create a guild for each game they are a part of.\n\n- Push notification for new messages, zergs and comments, so you don\'t have to refresh the page to see new activity.\n\nEnd of Part I',1,'154,148,2',NULL,'2014-04-21 23:33:01','2014-04-21 23:33:01',NULL,'NULL'),(532,3,NULL,NULL,'Question for all you lucky WildStar beta people.  Did you get to test out the player housing?  I\'m super excited for this as I think it really makes an MMO feel like a living breathing world.  Wanted to see how it was implemented?',1,'148',NULL,'2014-04-22 14:00:55','2014-04-22 14:00:55',NULL,'NULL'),(535,3,NULL,NULL,'Beyond Excited!  Just got my WildStar invite to the beta weekend this weekend!  Thinking of starting an Engineer, or a Spellslinger.  What are people playing and how are they liking the classes?',1,'154',NULL,'2014-04-23 16:17:25','2014-04-23 16:17:25',NULL,'NULL'),(536,2,NULL,NULL,'Has anyone gotten into the Technical alpha for Heroes of the Storm yet?  ',1,NULL,NULL,'2014-04-23 22:37:21','2014-04-23 22:37:21',NULL,'NULL'),(537,3,NULL,NULL,'Oh boy... playing the WildStar beta... so far AMAZING!',1,'154,148,2,67',NULL,'2014-04-25 12:33:53','2014-04-25 12:33:53',NULL,'NULL'),(544,2,139,'250','Why Team Builder drives me #&*$^#*T%$ nuts!  Exactly how much more can I carry?',1,'67',NULL,'2014-04-26 20:22:05','2014-04-26 20:22:05',NULL,'NULL'),(545,67,NULL,NULL,'What is your go-to snack/beverage when you are doing a marathon gaming day?     <br />\n<br />\nMine is starting with my Lattes (compliments of Verismo machine) and a Jimmy Dean\'s Light Breakfast sandwich...then later, Diet Cherry Dr. Pepper and any handheld food (hot pockets, taquitos, or a quick sandwich, like PB & J).',1,'2,4',NULL,'2014-04-27 23:06:57','2014-04-27 23:06:57',NULL,'NULL'),(546,67,NULL,NULL,'Not game related:  I am just sooo happy that Adam Silver (the NBA Commissioner) gave such an impassioned press conference today, and that Donald Sterling is FINALLY out of the NBA!',1,'2',NULL,'2014-04-29 13:23:45','2014-04-29 13:23:45',NULL,'NULL'),(549,148,NULL,NULL,'My new beast of a desktop PC will be arriving near the end of this month!\nMy new magnificent computer will cost a heart-attack inducing $3500, but will have very nice liquid cooling, a solid state drive, 32gb of RAM, a GTX 780 GPU and much more. Hopefully I don\'t drool over it in awe and cause a short circuit!',1,'67,2,157',NULL,'2014-05-02 08:23:21','2014-05-02 08:23:21',NULL,'NULL'),(562,4,NULL,NULL,'xbvvxcbcbc',0,NULL,NULL,'2014-05-02 14:59:45','2014-05-02 14:59:45',NULL,'NULL'),(563,4,NULL,'262','<div style=\"margin-top:10px\"></div>',0,NULL,NULL,'2014-05-02 15:28:05','2014-05-02 15:28:05',NULL,'NULL'),(565,4,NULL,'264','http://twitch.tv/messirolive/chat?popout=',0,NULL,NULL,'2014-05-02 15:31:19','2014-05-02 15:31:19',NULL,'NULL'),(566,4,NULL,'265','',0,NULL,NULL,'2014-05-02 15:33:16','2014-05-02 15:33:16',NULL,'NULL'),(569,67,NULL,NULL,'I game on my laptop, an Acer Aspire...it works for me.  The only downside to the laptop, is that it connects via the home WiFi, so it can get squirrelly sometimes.  I am low maintenance...which is good, since my significant other spends some serious dough on gaming PCs. ;)',1,'2',NULL,'2014-05-05 22:12:44','2014-05-05 22:12:44',NULL,'NULL'),(573,2,NULL,NULL,'Did anyone else watch the drama with Curse Voice?  Guess the beta that has been out for a couple of months for League of Legends had little added features, such as allowing you to see when your teammates Ulti was up (with a countdown timer) and also had timers for Dragon and Baron.  \n\nWell.. the community lost its collective minds and, credit to Riot, they decided that it was against TOS to give such an advantage, so Curse had to take out all the timers... making it still a cool voice supplement to the game, but not the game changer it was appearing as if it could be.\n\nOn the bad side.. I fear discussions about it have led people to discover some other products out there that will allow you to fully cheat at league, as I am seeing some people clearly using skill dodgers and auto csers now  :(.',1,NULL,NULL,'2014-05-12 01:45:48','2014-05-12 01:45:48',NULL,'NULL'),(574,148,NULL,'268','Haven\'t posted in a while..\n\nWildstar\'s name reservation madness was so out of control that it was almost not funny. It\'s still not funny for many people that due to server problems didn\'t get their name. For me it at least SAID that I successfully saved my character and guild name, so hopefully that wasn\'t an error. Won\'t be pleased if they revert the whole process as many people are begging for on the forums and Reddit.',1,'2',NULL,'2014-05-13 22:00:28','2014-05-13 22:00:28',NULL,'NULL'),(581,2,NULL,NULL,'So... I got into the Heroes of the Storm Alpha.. FINALLY.  I find the game pretty fun, but am disappointed that the original \"no chat\" has been removed.  One of the largest problems i found with LoL was dealing with toxic players on my own team and was hoping Heroes of the Storm would remove that.  It only took 2 games before someone was ranting in chat that the team is a bunch of &#$&%&  (well.. yeah... we are all playing it for the first time).\n\nI hope Blizzard gets lots of feedback and goes back to the no in game chat structure.. it really isn\'t necessary as anything you need to communicate can be done with pings.',1,NULL,NULL,'2014-06-07 16:00:55','2014-06-07 16:00:55',NULL,'NULL'),(582,148,NULL,'271','Lovin\' Wildstar. Taking me forever to level up since I keep wasting my time on being an Architect and Explorer. Can\'t get enough of stacking these speed flags. - https://www.youtube.com/watch?v=QQwhxH4h2e0',1,NULL,NULL,'2014-06-07 18:14:57','2014-06-07 18:14:57',NULL,'NULL'),(583,2,NULL,'272','The Renekton shutout!',1,'2',NULL,'2014-06-10 21:57:48','2014-06-10 21:57:48',NULL,'NULL'),(584,2,139,'273','Complete shutout on Aram.  Most lopsided game I have EVER played.',1,'2',NULL,'2014-06-16 22:21:01','2014-06-16 22:21:01',NULL,'NULL'),(585,2,139,'274','Followed by a shutout on Ziggs.... ',1,NULL,NULL,'2014-06-22 01:44:13','2014-06-22 01:44:13',NULL,'NULL'),(587,2,139,NULL,'After a horrible game, where I had to actually remove people from my friends list b/c I don\'t know why dragged me into their match if they are going to play completely hammered and then scream and yell at everyone else... I needed one of these. 6/1/7 with 285 CS.',1,NULL,NULL,'2014-06-29 03:22:00','2014-06-29 03:22:00',NULL,'NULL');
