/viewtopic.php?t=10104711&gid=265361',1,NULL,NULL,'2014-04-21 20:38:23','2014-04-21 20:38:23'),(61,147,69,272,1,NULL,'Anyone else unable to see members under the guild page? Or am I doing something wrong? : /',1,NULL,NULL,'2014-04-22 08:19:37','2014-04-22 08:19:37'),(62,153,69,340,3,NULL,'i can see the member list if i click on the member word next to our picture\n',1,NULL,NULL,'2014-04-22 08:49:33','2014-04-22 08:49:33'),(63,162,67,333,3,NULL,'Sorry I missed the test earlier this week, was with the in-laws.',1,NULL,NULL,'2014-04-28 00:46:16','2014-04-28 00:46:16'),(66,4,40,183,1,NULL,'Suggestions: The follow is a list of suggestions for additions/improvements to the website.\n\n-I didn\'t put these in bug reports, because they are things we either didn\'t include or simply didn\'t think about as we developed the site and you all have come up with some AMAZING ideas. We are currently working on implementing some of these very soon, as I will indicate below, while others will take and/or major restructuring and thus are not being immediately developed, but are part of our \"product roadmap\" for the future.\n\n- A crop tool for the profile banner, similar to what we have for profile images (This is currently being developed)\n\n- Adding a \"join guild\" link next to the start guild link. (This is currently being developed)\n\n- Being able to see who Zerg\'d your posts (This is currently being developed)\n\n- Notification of new comments being made to posts (This is currently being developed.. current solution is to have posts with new comments show the word comments and the number of comments in bold to indicate new comments have been added)\n\n- Ability to attach media when editing a post as well as when first entering the post (this is currently being developed)\n\n- Making distinction between character/game/server clearer on the left panel (this is currently being developed)\n\n- Adding an invite button to a guild, so the guild leader can invite people directly into a guild without them having to apply (this is currently being developed)\n\n- Ability change the order of their top characters and guilds on the left side of the profile page and in general add more customization to the profile pages.\n\n- Ability to add guilds that are multi-game guilds, so that guilds such as UMBRA do not have to create a guild for each game they are a part of.\n\n- Push notification for new messages, zergs and comments, so you don\'t have to refresh the page to see new activity.\n\nEnd of Part I',1,NULL,NULL,'2014-05-03 10:34:54','2014-05-03 10:34:54'),(67,153,67,338,3,NULL,'So, how are we progressing this test of ZergID?',1,NULL,NULL,'2014-05-07 02:04:23','2014-05-07 02:04:23');
