--
-- Table structure for table `zid_messages`
--

DROP TABLE IF EXISTS `zid_messages`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `zid_messages` (
  `message_id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL,
  `character_detail_id` int(11) DEFAULT NULL,
  `guild_id` int(11) DEFAULT NULL,
  `receiver_id` int(11) DEFAULT NULL,
  `guild_receiver_id` varchar(2000) DEFAULT NULL,
  `event_id` int(11) DEFAULT NULL,
  `parent_message_id` int(11) DEFAULT NULL,
  `parent_reply_message_id` int(11) DEFAULT NULL,
  `is_replied` tinyint(1) NOT NULL,
  `subject` varchar(100) DEFAULT NULL,
  `message` varchar(3000) DEFAULT NULL,
  `is_message_viewed` tinyint(1) NOT NULL,
  `is_event_message_viewed` varchar(2000) DEFAULT '',
  `is_message_parent` tinyint(1) NOT NULL,
  `is_garbage_message` varchar(100) DEFAULT NULL,
  `is_message_deleted` varchar(100) DEFAULT NULL,
  `is_message_active` tinyint(1) NOT NULL DEFAULT '1',
  `created_date` datetime NOT NULL,
  `last_modified_date` datetime NOT NULL,
  `is_sent_delete` tinyint(1) NOT NULL,
  PRIMARY KEY (`message_id`),
  KEY `FK_zid_messages_users(id)` (`user_id`),
  KEY `FK_zid_messages_character_detail(character_detail_id)` (`character_detail_id`),
  CONSTRAINT `FK_zid_messages` FOREIGN KEY (`user_id`) REFERENCES `zid_users` (`id`),
  CONSTRAINT `FK_zid_messages_character_detail?character_detail_id?` FOREIGN KEY (`character_detail_id`) REFERENCES `zid_character_details` (`character_detail_id`)
) ENGINE=InnoDB AUTO_INCREMENT=582 DEFAULT CHARSET=latin1;
/*!40101 SET character_set_client = @saved_cs_client */;

