d Friend Request','Your friend Ren',0,'',1,NULL,NULL,1,'2014-04-18 18:58:06','2014-04-18 18:58:06',0),(468,148,NULL,NULL,154,NULL,NULL,NULL,NULL,0,'New Message','Message test. Got a red \"1\" notification? See if it goes away when you read and delete this.',1,'',1,'154','154',1,'2014-04-19 15:15:08','2014-04-19 15:15:08',0),(469,154,NULL,NULL,148,NULL,NULL,468,NULL,0,'Reply Message','Yeah, it\'s gone now.',1,'',1,'154,148','154',1,'2014-04-19 20:56:30','2014-04-19 20:56:30',0),(472,148,NULL,67,154,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',0,'',1,'154','154',1,'2014-04-20 12:10:51','2014-04-20 12:10:51',0),(473,148,NULL,NULL,2,NULL,NULL,NULL,NULL,0,'New Message','Hey, just one suggestion.\n\nBeing able to \"add media\" to a post while editing it would be a nice addition. It seems to be the one thing missing compared to making a new post - that and which character it\'s posted as.',1,'',1,NULL,NULL,1,'2014-04-20 01:59:30','2014-04-20 01:59:30',0),(474,148,NULL,NULL,2,NULL,NULL,NULL,NULL,0,'New Message','Second suggestion!\n\nUnless it\'s intended to be hidden, being able to click the \"1 zerg\" or however many on a post beside \"zerg it!\" to see who has \"zerged\" it would be a useful tool. At the moment it seems to be anonymous.',1,'',1,NULL,NULL,1,'2014-04-20 02:01:52','2014-04-20 02:01:52',0),(475,148,NULL,NULL,2,NULL,NULL,NULL,NULL,0,'New Message','More suggestions!\n\n•In the left hand column where top characters and guilds are listed, if the name of the character and the game related to it could be separate somehow, such as the game being italic and smaller, or the guild/character being bold and underlined, that would be helpful.\n\n•To my knowledge, there is no way to invite people to a guild - they must request entry. I expect guild invitations would be on the to-do list. This is a tough one, because we wouldn\'t want people receiving spam invites from random guilds trying to advertise that way...\n\n•Lastly for now - Allowing guilds to list multiple games would be largely useful for multi-gaming communities such as Umbra. Could this be implemented at some point?\n\nThat\'s it for now, haha. Messaging you seems a bit more convenient for suggestions and reports. Is it so for you, or would you like them sent to the email?',1,'',1,NULL,NULL,1,'2014-04-20 02:10:28','2014-04-20 02:10:28',0),(476,148,312,67,NULL,'148',179,NULL,NULL,0,'New Event Notification','A curious event from our website calendar.',0,'148',1,'148',NULL,1,'2014-04-20 12:58:44','2014-04-20 00:28:18',0),(477,148,NULL,NULL,147,NULL,NULL,NULL,NULL,0,'New Message','Hey, just curious, where did you find that \"U\" image for Umbra? The one I have from the media forum section is not as fancy, haha. Could you direct me to your source or email some Umbra material to me possibly?',1,'',0,NULL,NULL,1,'2014-04-20 02:39:22','2014-04-20 02:39:22',0),(478,147,NULL,NULL,148,NULL,NULL,477,NULL,0,'Reply Message','I don\'t remember where I got it at. Probably from the official Umbra media tumblr thingy or whatever. However, I can email it to ya. What\'s your email?',1,'',0,NULL,NULL,1,'2014-04-20 03:39:26','2014-04-20 03:39:26',0),(479,148,NULL,NULL,147,NULL,NULL,477,NULL,0,'Reply Message','Aeternamail@gmail.com\n\nThanks! :D',1,'',0,NULL,NULL,1,'2014-04-20 04:15:09','2014-04-20 04:15:09',0),(481,157,282,NULL,158,NULL,NULL,NULL,NULL,0,'Send Friend Request','From Guild Umbra',0,'',1,NULL,NULL,1,'2014-04-20 07:07:43','2014-04-20 07:07:43',0),(482,2,NULL,NULL,148,NULL,NULL,473,NULL,0,'Reply Message','Yes... that is a really good idea.  I feel like that should be an easy change to make, since we already have all the tools in place when you first make a post.  With that said, I have found that often the things I think will be easy, are the most complicated changes and the things that I fear will be complicated, can be done in a few hours.\n\nFor example, in our first design we only had calendar for the guild system and then realized we wanted anyone to be able to invite any of their friends to a game event if they wanted.  I thought this would be a major project.. took them a day.  On the other hand, you will notice guild forums are \"coming soon\".. that is because after 4 weeks we were unable to properly integrate any forum into our system, as each one broke something else so badly.',1,'',1,NULL,NULL,1,'2014-04-20 11:41:31','2014-04-20 11:41:31',0),(483,2,NULL,NULL,148,NULL,NULL,474,NULL,0,'Reply Message','I\'d love to be able to see the Zerg\'s as well.  This is one we have put in our product roadmap, but I am told it is a major addition, along the same lines as having the alert for the comment system.  (We will probably add those at the same time).',1,'',1,NULL,NULL,1,'2014-04-20 11:48:37','2014-04-20 11:48:37',0),(484,2,NULL,NULL,148,NULL,NULL,475,NULL,0,'Reply Message','\"In the left hand column where top characters....\"\n\nThis should be easy... and I agree, it will look much nicer if we show character name and game in a slightly different format to set them off.\n\n\"•To my knowledge, there is no way to invite people to a guild...\"\n\nBingo!  When we considered having an option like this, I remembered the number of games where I would see spam \"join our guild\" messages in all chat and thought of people logging in to find 20 messages, only to see that some guilds created a bot that can crawl the site and spam invites.\n\nMaybe a way around this is to restrict invites to friends on same game/faction/server.  So, guild leaders and officers can send out invites to people they are already friends with.  You still may get some spam, like I get on Facebook from friends who constantly want me to like their pages, but that would at least reduce it.\n\nI\'m going to run it past our CTO and see how major something like this would be to implement.\n\n\n\"•Lastly for now - Allowing guilds to list multiple games....\"\n\nAbsolutely could be implemented (and likely will), but it will require some major changes.  Right now the calendaring system is very simple, because it is restricted.  When you create an event as a guild, the game/faction/server is automatically chosen.  When you create an event for your friends, you have to choose the character, which restricts the game/faction/server in the same way.  As we created this system I thought of a guild I was in for a short time that spanned both factions in LoTRO and was told it would require major restructuring... so the answer is yes.. we will go there, but that chance is likely a few months away.  (After we have an onsite programming team we can work with in real time)\n\n\"Messaging you seems a bit more convenient for suggestions and reports. Is it so for you, or would you like them sent to the email?\"\n\nBoth work great for me, so whatever is easier for you!\n\nThanks again for all your help.\n',1,'',1,NULL,NULL,1,'2014-04-20 12:07:27','2014-04-20 12:07:27',0),(485,2,NULL,NULL,148,NULL,NULL,NULL,NULL,0,'New Message','Quick Question RE: Multigame guilds.  I am currently sending over a list of future suggestions you all have supplied that we want to add to the product roadmap.  However, something occurred to me as I was thinking through Guilds across multiple games.\n\nIs there an instance where the guild leader is different in different games or is the leader pretty much the leader, even if they don\'t wind up joining a specific game?',1,'',0,NULL,NULL,1,'2014-04-20 12:45:14','2014-04-20 12:45:14',0),(486,147,NULL,NULL,148,NULL,NULL,477,NULL,0,'Reply Message','Sent.',1,'',1,NULL,NULL,1,'2014-04-20 15:26:04','2014-04-20 15:26:04',0),(487,148,NULL,NULL,2,NULL,NULL,485,NULL,0,'Reply Message','Lord Hammer (Mark Taylor)is the overall Guild Master, and we have \"Chapter Leaders\" as well, and they effectively are in charge of each game so that leadership is more focused, and so that Hammer can spend his time on Umbra as a whole. I didn\'t think of that at first - good catch. If there was some sort of system that created sections of a multi-gaming guild, and allowed for there to be leaders of specific sections, that would be superb. Hopefully that\'s not too large of a change for what\'s already in place.',1,'',1,NULL,NULL,1,'2014-04-20 15:30:11','2014-04-20 15:30:11',0),(488,148,NULL,NULL,147,NULL,NULL,477,NULL,0,'Reply Message','Woohoo, thanks!',1,'',1,NULL,NULL,1,'2014-04-20 15:31:56','2014-04-20 15:31:56',0),(490,148,NULL,NULL,147,NULL,NULL,NULL,NULL,0,'New Message','Hey, just to let you know, the UMBRA page for ESO you created has application requests disabled, so nobody can request to join. At the moment there\'s no way to invite, so it may be good to edit and allow requests.\n\nSpent like 10 minutes trying to figure out why the apply button wasn\'t there... lol.',1,'',1,NULL,NULL,1,'2014-04-20 16:21:46','2014-04-20 16:21:46',0),(491,2,NULL,NULL,148,NULL,NULL,485,NULL,0,'Reply Message','Ultimately, nothing is too large... you just have to plan these things very carefully (which is why I ask a lot of questions) and allow enough time to do things correctly.\n\nHow we would probably implement it is to create a new system especially for multigame guilds, which would copy some of the existing code for single game guild systems, but taking into account the differences for a multigame guilds and allow it to fit in with our calendaring system.  We would probably add another level to guild hierarchy, creating a \"guild leader\" and then \"game leader\" and then officers.  The trick will be figuring out whether making someone an officer of a the guild, should make them officers in all games, or if it each game has its own set of officers. \n\nI\'ve been in a couple of multigame guilds, but each one did things differently.  The last one I was in was in GW2 and I can\'t remember the name of it, but they had game specific leaders and officers.  I didn\'t spend too much time in it, as I was so far down the ladder and didn\'t have the patience to move up.  The other one I was in, was an \"elite\" PvP guild, but we kinda moved from game to game together, so we weren\'t even really in two games at the same time.. I think there only like 15 members total and we basically did arena fighting in SWOTOR, GW2 and then some moved onto LoL, but they mostly dispersed after that.\n\nAnyway.. my point is that I want to make sure we implement this type of addition in a way that will work for most multi-game guilds structures and allow even those that don\'t fit the mold to customize accordingly.',1,'',1,NULL,NULL,1,'2014-04-20 17:45:57','2014-04-20 17:45:57',0),(492,147,NULL,NULL,148,NULL,NULL,490,NULL,0,'Reply Message','Haha thanks for the info. I wasn\'t even sure what that checkbox did. That explains it!',1,'',1,NULL,NULL,1,'2014-04-20 17:59:46','2014-04-20 17:59:46',0),(494,148,NULL,NULL,176,NULL,NULL,NULL,NULL,0,'Send Friend Request','Me!\n\nP.S. Search \"UMBRA\" and see if you can join the guild listed under Wildstar.',0,'',1,NULL,NULL,1,'2014-04-21 02:11:38','2014-04-21 02:11:38',0),(499,147,NULL,69,186,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',0,'',1,NULL,NULL,1,'2014-04-22 00:58:41','2014-04-22 12:58:41',0),(500,148,NULL,67,165,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',1,'',1,NULL,NULL,1,'2014-04-22 00:58:47','2014-04-22 12:58:47',0),(501,148,NULL,67,162,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',1,'',1,NULL,NULL,1,'2014-04-22 00:58:55','2014-04-22 12:58:55',0),(503,143,NULL,42,159,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',0,'',1,NULL,NULL,1,'2014-04-22 05:44:49','2014-04-22 05:44:49',0),(504,143,NULL,42,155,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',0,'',1,NULL,NULL,1,'2014-04-22 05:44:54','2014-04-22 05:44:54',0),(505,143,267,NULL,NULL,'143,',180,NULL,NULL,0,'New Event Notification','ZergID testing',0,'143',1,NULL,NULL,1,'2014-04-22 05:45:50','2014-04-21 20:16:47',0),(507,147,NULL,69,148,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',1,'',1,NULL,NULL,1,'2014-04-22 06:06:22','2014-04-22 06:06:22',0),(508,148,NULL,NULL,2,NULL,NULL,NULL,NULL,0,'New Message','I see we now have a bug report button on the banner, but unfortunately it does not work for me. I have tried it in Chrome, IE, and Firefox. In Chrome it does not react in any way, even with popups allowed and adblock disabled. I have tried having an email tab open, that did nothing. In Firefox, trying to even access ZergID gives an error \" SSL received a record that exceeded the maximum permissible length.\", and in IE it\'s the same problem with Chrome.\n\nIs it supposed to control an email application and open an email, or is it supposed to open a new box on the page? I4anI is having the same problem as me I believe.',1,'',0,NULL,NULL,1,'2014-04-21 19:41:31','2014-04-21 19:41:31',0),(512,148,NULL,NULL,189,NULL,NULL,NULL,NULL,0,'Send Friend Request','Me!',1,'',1,'189',NULL,1,'2014-04-21 20:10:21','2014-04-21 20:10:21',0),(515,148,NULL,67,153,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',1,'',1,NULL,NULL,1,'2014-04-22 06:39:43','2014-04-22 06:39:43',0),(516,148,312,NULL,153,NULL,NULL,NULL,NULL,0,'Send Friend Request','Me',1,'',1,'153',NULL,1,'2014-04-21 20:14:03','2014-04-21 20:14:03',0),(517,153,NULL,NULL,143,NULL,NULL,NULL,NULL,0,'Friend Message','Testing the direct message with acount character',1,'',0,NULL,NULL,1,'2014-04-21 20:15:12','2014-04-21 20:15:12',0),(519,148,NULL,67,174,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',0,'',1,NULL,NULL,1,'2014-04-22 06:47:21','2014-04-22 06:47:21',0),(520,148,NULL,67,174,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',0,'',1,NULL,NULL,1,'2014-04-22 06:47:21','2014-04-22 06:47:21',0),(523,148,NULL,67,187,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',1,'',1,NULL,NULL,1,'2014-04-22 06:48:19','2014-04-22 06:48:19',0),(524,187,NULL,NULL,1,NULL,NULL,NULL,NULL,0,'My game is not listed','Elder Scrolls Online',0,'',1,NULL,NULL,1,'2014-04-21 20:19:41','2014-04-21 20:19:41',0),(527,148,NULL,NULL,2,NULL,NULL,NULL,NULL,0,'New Message','Hey, just a little thing, not much of a bug. - In guild pages, officers\' posts do not appear on the \"members\" post feed. It may be best to have all ranks have their posts in the \"members\" feed.',1,'',1,NULL,NULL,1,'2014-04-21 20:22:31','2014-04-21 20:22:31',0),(530,148,312,NULL,NULL,'148,154,162,187',182,NULL,NULL,0,'New Event Notification','Test event. Accept if you can!',0,'148,187,154,162',1,'154','154',1,'2014-04-22 06:54:08','2014-04-21 18:25:35',0),(531,148,NULL,67,190,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',1,'',1,NULL,NULL,1,'2014-04-22 06:54:14','2014-04-22 06:54:14',0),(533,148,312,67,NULL,'148,154,165,162,153,174,187,190',183,NULL,NULL,0,'New Event Notification','Test Event. Auto-accepting RSVPs.',0,'148,174,190,187,153,165,154,162',1,'154','154',1,'2014-04-22 06:55:48','2014-04-21 18:26:34',0),(534,148,NULL,NULL,2,NULL,NULL,NULL,NULL,0,'New Message','One little suggestion: The notification/mail icon is currently set to only update once the page is refreshed or changed. It would be nice if it was a live-feed change kind of thing, so that it you\'re sitting on one page, the notification would pop up without having to refresh.\n\nBtw, we are doing a mini-ZergID event right now with a few people trying to find bugs.',1,'',1,NULL,NULL,1,'2014-04-21 20:30:48','2014-04-21 20:30:48',0),(538,189,NULL,NULL,190,NULL,NULL,NULL,NULL,0,'Friend Message','Were friiiiiiiiiends..  not like ill ever log into this again.',1,'',1,NULL,NULL,1,'2014-04-21 20:35:34','2014-04-21 20:35:34',0),(540,190,NULL,NULL,189,NULL,NULL,538,NULL,0,'Reply Message','yea man this just another headache ',0,'',1,NULL,NULL,1,'2014-04-21 20:38:16','2014-04-21 20:38:16',0),(541,148,NULL,70,153,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',1,'',1,NULL,NULL,1,'2014-04-22 07:07:30','2014-04-22 07:07:30',0),(542,190,NULL,NULL,189,NULL,NULL,538,NULL,0,'Reply Message','this or our website pick one im logging into both\n',0,'',1,NULL,NULL,1,'2014-04-21 20:39:01','2014-04-21 20:39:01',0),(543,190,NULL,NULL,189,NULL,NULL,538,NULL,0,'Reply Message','im not***\n',0,'',1,NULL,NULL,1,'2014-04-21 20:39:21','2014-04-21 20:39:21',0),(545,143,NULL,NULL,153,NULL,NULL,517,NULL,0,'Reply Message','yo',1,'',0,NULL,NULL,1,'2014-04-21 20:48:27','2014-04-21 20:48:27',0),(546,2,NULL,NULL,148,NULL,NULL,508,NULL,0,'Reply Message','It is just supposed to open an e-mail browser and direct and e-mail to suggestions@zergid.com \n\nWe wanted to go with the quickest easiest route and Alex and I were concerned that creating a \"bug report form\" may cause some items to get lost, so felt it was easier to just have a hyperlink with the e-mail address as the result.\n\nI\'ve tested on my CPU and it opens up an outlook e-mail.\n\nAre you on a mac per chance or using a different e-mail program?  I\'m going to add it to a list of bugs I will post in a little bit, but I will need more information to give to the tech team or else they will just tell me \"we cannot recreate\" and shrug it off.',1,'',0,NULL,NULL,1,'2014-04-21 21:30:10','2014-04-21 21:30:10',0),(547,2,NULL,NULL,148,NULL,NULL,527,NULL,0,'Reply Message','They are ABSOLUTELY supposed to post on the members feed as well as the officers feed.  The members feed was supposed to be inclusive of all members (whether officer or not, while the officer feed was meant to be able to \"cut through the noise\" especially in larger guilds.  Going to add that to the bug list immediately!\n\nThank you!',1,'',1,NULL,NULL,1,'2014-04-21 21:31:20','2014-04-21 21:31:20',0),(548,2,NULL,NULL,148,NULL,NULL,534,NULL,0,'Reply Message','Couldn\'t agree more on that and we plan to implement a push notification system as soon as possible.  The problem, we have been told, is that it absolutely EATS bandwidth.  \n\nWe want to also implement the same system for Zergs, events, etc.. so that you don\'t have to refresh to see if someone posts something new and/or comments on a post, etc.',1,'',1,NULL,NULL,1,'2014-04-21 21:39:36','2014-04-21 21:39:36',0),(549,148,NULL,NULL,2,NULL,NULL,508,NULL,0,'Reply Message','Ah, naw, I\'m on Windows 8.1. - The link just doesn\'t seem to work with Gmail or Hotmail. I don\'t have Outlook on my computer.',1,'',0,NULL,NULL,1,'2014-04-21 22:15:51','2014-04-21 22:15:51',0),(550,2,NULL,NULL,148,NULL,NULL,508,NULL,0,'Reply Message','Of course.. why would an e-mail hyperlink worth with Gmail or Hotmail??  *banging my head against the keyboard*  I\'m going to e-mail this over to the tech team and see if they can figure out a way to make it work.\n\nI am guessing it is because windows isn\'t seeing a \"default\" e-mail client, so it is just ignoring the link and I fear there won\'t be an easy fix for it.  If not, i will have them switch it to some type of form fill.. I just want to make sure I get all the messages and I feared that a form box would cause something to get lost along the way and I would miss an important bug and/or suggestion.\n\nWho knew there would be a bug report for the bug report link.  It does make me laugh.',1,'',0,NULL,NULL,1,'2014-04-21 22:30:32','2014-04-21 22:30:32',0),(551,147,NULL,69,187,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',0,'',1,NULL,NULL,1,'2014-04-22 12:53:44','2014-04-22 12:53:44',0),(552,147,NULL,69,179,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',0,'',1,NULL,NULL,1,'2014-04-22 12:53:46','2014-04-22 12:53:46',0),(553,147,NULL,69,153,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',1,'',1,NULL,NULL,1,'2014-04-22 12:53:48','2014-04-22 12:53:48',0),(554,147,NULL,69,189,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',0,'',1,NULL,NULL,1,'2014-04-22 12:53:51','2014-04-22 12:53:51',0),(555,147,NULL,69,191,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',0,'',1,NULL,NULL,1,'2014-04-22 12:53:53','2014-04-22 12:53:53',0),(557,2,NULL,NULL,148,NULL,NULL,508,NULL,0,'Reply Message','I don\'t think they are going to be able to fix this one.. I am basically told that it looks for a default e-mail client and with windows, if it doesn\'t have one, it just sits there.. mystified.\n\nAre you okay if we leave it like this?  As I mentioned before, i fear the \"form box\" or other method b/c that means I am relying on the system to generate a form e-mail to me, which could go wrong in so many different ways and I want to make sure I get as much feedback as possible.  You can keep submitting bugs/suggestions in game, as can anyone else with an issue with the e-mail.',1,'',1,NULL,NULL,1,'2014-04-22 16:30:32','2014-04-22 16:30:32',0),(558,148,NULL,NULL,2,NULL,NULL,508,NULL,0,'Reply Message','Ya no worries, I got no problems with that. Doesn\'t hinder me from reporting things. :)',1,'',1,NULL,NULL,1,'2014-04-22 18:24:38','2014-04-22 18:24:38',0),(562,148,NULL,NULL,2,NULL,NULL,NULL,NULL,0,'New Message','Heya, Drsleak is in, and I was wondering if you as well would be interested in joining Guild Umbra for your Wildstar escapades? You\'d clearly be an excellent fit and a valued member, and what harm is there in having a bunch of organized people to play with at launch? :)',1,'',1,NULL,NULL,1,'2014-04-26 12:39:32','2014-04-26 12:39:32',0),(563,2,NULL,NULL,148,NULL,NULL,562,NULL,0,'Reply Message','I absolutely would be in if I was going to be joining Wildstar, but I am not sure if I am going to play that one.  I would definitely want to get my hands on a beta key before buying it.  There have been so many games I tried out in beta and realized I didn\'t like, while others I really loved.\n\nI have been waiting to see how ESO was going to be on the PS4 and have been salivating waiting for Heroes of the Storm.',1,'',1,NULL,NULL,1,'2014-04-26 19:10:41','2014-04-26 19:10:41',0),(567,148,NULL,67,199,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',0,'',1,NULL,NULL,1,'2014-04-29 21:57:11','2014-04-29 09:57:11',0),(569,143,NULL,NULL,153,NULL,NULL,517,NULL,0,'Reply Message','Whats up\n',1,'',1,NULL,NULL,1,'2014-05-01 20:09:33','2014-05-01 20:09:33',0),(570,148,NULL,67,203,NULL,NULL,NULL,NULL,0,'Membership Accepted','Congratulations, your application to UMBRA has been accepted',1,'',1,NULL,NULL,1,'2014-05-02 18:45:02','2014-05-02 06:45:02',0),(571,110,NULL,NULL,4,NULL,NULL,NULL,NULL,0,'Send Friend Request','Hai Jaseeem',1,'',1,'4',NULL,1,'2014-05-02 11:49:21','2014-05-02 11:49:21',0),(572,208,NULL,NULL,1,NULL,NULL,NULL,NULL,0,'My game is not listed','Conquer Online 2.0',0,'',1,NULL,NULL,1,'2014-05-02 21:22:28','2014-05-02 21:22:28',0),(575,4,NULL,NULL,1,NULL,NULL,271,NULL,0,'Reply Message','ok',0,'',1,NULL,NULL,1,'2014-05-08 03:10:36','2014-05-08 03:10:36',0),(576,4,NULL,NULL,1,NULL,NULL,272,NULL,0,'Reply Message','bcvnb',0,'',1,'4',NULL,1,'2014-05-08 03:11:35','2014-05-08 03:11:35',0),(579,208,NULL,NULL,1,NULL,NULL,NULL,NULL,0,'My game is not listed','League of Angels',0,'',1,NULL,NULL,1,'2014-05-26 18:34:59','2014-05-26 18:34:59',0),(580,130,NULL,NULL,119,NULL,NULL,NULL,NULL,0,'Send Friend Request','Yo!',0,'',1,NULL,NULL,1,'2014-06-21 15:24:14','2014-06-21 15:24:14',0),(581,130,239,NULL,131,NULL,NULL,NULL,N